import React from "react";
import type { BoardData } from "../types/types";

interface FooterProps {
  board: BoardData;
}

const Footer: React.FC<FooterProps> = ({ board }) => {
  const backlogTasks = board.find(col => col.id === "backlog")?.issues.length || 0;
  const finishedTasks = board.find(col => col.id === "finished")?.issues.length || 0;

  return (
    <footer
      style={{
        display: "flex",
        justifyContent: "space-between",
        padding: "10px 20px",
        background: "#f4f5f7",
        borderTop: "1px solid #ccc",
        fontSize: "14px"
      }}
    >
      <div>
        Active: {backlogTasks} | Finished: {finishedTasks}
      </div>
      <div>
        Created by: Your Name
      </div>
    </footer>
  );
};

export default Footer;
